Points on an Elliptic Curve: pub struct Point { pub x: Fp, pub y: Fp,
} Represents a point on an elliptic curve. Each point consists of two coordinates, x and y, defined over a finite field Fp. Points are fundamental in ECC and are used to represent public keys and other elements necessary for cryptographic operations Private and Public Keys: pub struct PrivateKey { pub secret: Fp,
} pub struct PublicKey { pub point: Point,
} PrivateKey: Stores a single scalar value (secret) which acts as a private key. PublicKey: Derived from the private key by scalar multiplication of a base point on the elliptic curve. It is essentially a point on the curve. Ephemeral Keys: pub struct EphemeralPrivKey { pub secret: Fp,
} pub struct EphemeralPubKey { pub point: Point,
} Ephemeral Keys: These keys are temporary and used for a single transaction or session to enhance security. They follow the same structure as permanent keys but are not stored long-term.
